import React from "react";
import { Card } from "react-bootstrap";
import { useNavigate } from "react-router-dom";

export default function FreeLancerCard(props) {
  const { item } = props;

  const styles_text = {
    color: "#fff",
    fontSize: "15px",
  };
  const styles_button = {
    color: "#fff",
    backgroundColor: "#27AE60",
    border: "none ",
    borderRadius: "5px",
    width: "auto",
    fontSize: "15px",
    fontWeight: "500",
    padding: "5px",
  };

  const navigate = useNavigate();
  return (
    <div
      style={{
        width: "15rem",
        height: "80px",
        backgroundColor: "#212121",
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "space-around",
        border: "#27AE60 solid 1px",
        margin: "1rem",
      }}
    >
      <div className="freelancer-photo" style={{ position: "relative" }}>
        <img
          width={"80px"}
          src="https://pbs.twimg.com/profile_images/1478358634992181248/z18Bm6U0_400x400.jpg"
          alt=""
          style={{
            borderRadius: "100%",
            borderWidth: "1px",
            borderColor: "#27AE60",
            borderStyle: "solid",
            zIndex: "2",
            position: "absolute",
            top: "-79px",
            left: "-34px",
          }}
        />
      </div>
      <div className="freelancer-desc">
        <h5 style={styles_text}>{item.first_name}</h5>
        <h5 style={styles_text}>{item.last_name}</h5>
        <h5 style={styles_text}>{item.profession}</h5>
      </div>
      <div>
        <button
          style={styles_button}
          onClick={() => {
            navigate("/details");
          }}
        >
          Learn more
        </button>
      </div>
    </div>
  );
}
